const ChefItem = ({ chef }) => {
  const arr = [];
  console.log(chef)
  for(let i=0; i<chef.length; i++) {
     if (chef[i].chefName === "Yossi Shitrit") {
    arr.push({ name: chef[i].restaurantName, img: chef[i].restaurantImage });
  }
  }

  console.log(arr);
  return (
    <div>
      {arr.map((chef) => {
        <div className="chef-restaurant-item">
          <img
            src={chef.restaurantImage}
            alt="img"
            className="chef-restaurant-img"
          />{" "}
          <h3>{chef.restaurantName}</h3>
        </div>;
      })}
      ;
    </div>
  );
};

export default ChefItem;
